import * as firebase from 'firebase';

// Initialize Firebase
const firebaseConfig = {
    apiKey: "AIzaSyCClp8qV6ATBPv5K0bAkzimUa2B-LQqphg",
    authDomain: "front-gym.firebaseapp.com",
    databaseURL: "https://front-gym.firebaseio.com",
    projectId: "front-gym",
    storageBucket: "front-gym.appspot.com",
    messagingSenderId: "211525000826",
    appId: "1:211525000826:web:d956ed3545e2016d"

};

const fb = firebase.initializeApp(firebaseConfig);
const db = firebase.firestore();


//Export firestore database
export {
    fb,
    db
}
